<style>
  * {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
  }

  body {
    font-family: 'Inter', -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, sans-serif;
    line-height: 1.6;
    color: #333;
  }

  .header-container {
    width: 100%;
    background: linear-gradient(135deg, #7fb3a0 0%, #6ba389 100%);
    color: white;
    padding: 20px 40px;
    display: flex;
    justify-content: space-between;
    align-items: center;
    min-height: 80px;
  }

  .company-info {
    flex: 1;
  }

  .company-logo {
    display: flex;
    align-items: center;
    gap: 15px;
  }

  .company-logo-img {
    max-height: 50px;
    width: auto;
    display: block;
  }

  .we-are {
    font-size: 24px;
    font-weight: 700;
    color: white;
    line-height: 1;
  }

  .renewables {
    font-size: 24px;
    font-weight: 700;
    color: #333;
    line-height: 1;
  }

  .page-title h2 {
    font-size: 18px;
    font-weight: 600;
    color: white;
    margin: 0;
  }

  /* Print Styles */
  @media print {
    .header-container {
      background: #7fb3a0 !important;
      -webkit-print-color-adjust: exact;
      color-adjust: exact;
    }
  }
</style>
